import React, { useState } from "react";
import { Button, Container, Nav, Navbar } from "react-bootstrap";
import { useHistory } from "react-router-dom";
const Header = () => {

  const [open , setOpen] = useState(false);

  const history = useHistory();

  const handlePostJob = () => {
    history.push("/postjob");
  };

  const toggleModal =() => {
    setIsOpen(!open);
  }

  const handleLogout = () => {
    history.push("/");
  };

  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="./vacancies">Campus Recruitment System</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="./vacancy">Vacancies</Nav.Link>
          <Nav.Link href="./profile">Profile</Nav.Link>
          <Nav.Link href="./companies">Companies</Nav.Link>
          <Nav.Link href="./alljobs">All Jobs</Nav.Link>
          <Nav.Link href="./appliedjobs">Applied Jobs</Nav.Link>
          <Nav.Link href="./profilee">Profile</Nav.Link>

          <Button className="navbutton" variant="outline-success" onClick={handlePostJob}>
            Post Job
          </Button>
          <Button className="buttonlogout" variant="outline-light" onClick={handleLogout}>
            Logout
          </Button>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default Header;
